import functools
import unittest
from typing import List



class Solution:
    def maximumScore(self, nums: List[int], multipliers: List[int]) -> int:
        n, m = len(nums), len(multipliers)
        di = {}
        @functools.lru_cache(2000)
        def helper(start, i):
            if i == m: return 0
            if (start, i) in di:
                return di[(start, i)]
            end = n - (i-start) - 1 # no need for third parameter "end". We can calculate that easily
            pick_left = nums[start] * multipliers[i] + helper(start + 1, i + 1)
            pick_right = nums[end] * multipliers[i] + helper(start, i+1)
            ans = max(pick_left,pick_right)
            di[(start, i)] = ans
            return ans

        helper.cache_clear()
        return helper(0,0)




